INSERT INTO `section6` (`id`, `facility`, `responsible`, `testtype`, `distribution`, `timeframe`, `day`, `send`, `contactperson`, `name`, `no`, `emergencykits`, `XpertTracking`, `system`, `howoften`, `Kitsstored`, `Managed`, `com`) VALUES
(4, '14947', 'Partner Budget (specify which tests)', '', 'Pull System', 'Monthly', 'No', '0', 'Yes', 'Alfred Kivisha (DTLC)', '0722384290', '', 'Stock ledger book', 'Yes', 'Monthly', 'In the microbiology lab', ' Managed through stock cards', 'The facility has an EMR systems Mediboss that is being used to track all patients. The med sup requested that systems developed interface with existing systems.'),
(3, '15834', 'Partner Budget (specify which tests)', '', 'Pull System', 'Quarterly', 'No', '', 'Yes', 'Mr. Moseti (Incharge of microbiology lab)', '0723641595', '1', 'Stock ledger book', 'No', '0', 'In the laboratory TB bench ', ' ', 'Back up  for the gene expert is too small to withstand fluctuations. The GeneXpert machine requires a larger UPS. \r\nPasteur pipettes provided with the kit are not enough to perform one test. An additional pasteur pipette is required for each sample for processing and transfer of samples to the cartridge\r\nBench lacks masks for processing the samples- risk hazard for the health care workers \r\n'),
(5, '14706', 'Partner Budget (specify which tests)', '', 'Pull System', 'Others', 'Yes', 'Partner', 'Yes', 'Sheila', '', 'Have only ordered once since they started testing', 'Stock ledger book', 'Yes', 'Monthly', '  At the main Hospital stores', ' Stock cards', ' The Information system used in the hospital does not include TB data. All TB related information is handled in registers at the lab and clinic.'),
(6, '11522', 'Partner Budget (specify which tests)', '', 'Pull System', 'Others', 'No', '0', 'Yes', 'Mr Kisang', '0721545675', '', 'Not recorded	', 'Yes', 'Monthly', '  Small supplies are stored in the lab while large supplies are stored in Mtongwe under controlled temperatures', ' They arrange on how to get them e.g. if the DTLC is available he does for them or if not, the ambulance collects and delivers', ' '),
(7, '13528', 'Partner Budget (specify which tests)', 'GeneXpert Reagents', 'Pull System', 'Weekly', 'Yes', 'Partner', 'No', '', '', 'No supplies for the last one year', 'Stock ledger book', 'Yes', 'Weekly', 'In the TB Bench', ' ', 'Challenges shared by lab and clinical officer in charge of the facility:\r\n1. Cartridges- not readily available. stock outs for the lat one year\r\n2. Lack of training- only one person at the lab trained to use GeneXpert who was on leave hence testing stopped\r\n3. paediatric medication- request for new testing algorithm and protocol and training by DTLC \r\n4. Integration of HIV and TB services- not enough space- TB clinic is in a small tent \r\n5. Lab is an improvised room that lack enough space to manage quality testing \r\n6. Lack of enough staff at the lab\r\n7. Lack of sufficient equipment to perform basic tests because of poor lab infrastructure '),
(8, '22222', 'Partner Budget (specify which tests)', 'GeneXpert Reagents', 'Pull System', 'Quarterly', 'No', '0', 'Yes', 'Procurement Officer (Details not provided)', '', '', 'Electronic system	', 'Yes', 'Monthly', 'In the cold room storage ', 'Weeks worth of kits required for testing are requested for through order form. These are recorded in the stock ledger in the cold room. Kits are stored in TB lab on shelves and brought to room temperature before testing ', ' '),
(9, '13608', 'Partner Budget (specify which tests)', 'GeneXpert Reagents', 'Pull System', 'Quarterly', 'No', '0', 'Yes', 'David Juma (Pharmacist MSF)', '0723442353', '0', 'Stock ledger book', 'Yes', 'Biweekly', 'In the TB lab shelves next to the machine at RTP.', ' ', ' Challenges:-\r\n1. Workload for genexpert is expected to rise and the facility only has one GeneXpert that can perform 12 tests per day. The facility is meant to serve over 20 referral facilities in the region Request for an upgrade of equipment or additional GX IV \r\n2. Personnel: MSF are pulling out support in TB lab and the MoH are required to continue to support services but without sufficient staffing, lab staff are stretched to meet demands \r\n3. Require a new UPS for the GeneXpert machine. This is being pursed by facility in charge with MSF \r\nStock out of microscopy reagents in the entire district and neighbouring districts forcing the facility to use GeneXpert for TB identifications \r\n4. Lack of supplies of masks \r\n5. Request for the national Lab requisition for to include a column for both microscopy and culture lab numbers\r\n6. Calibration of GeneXpert has not been done'),
(10, '11555', 'CMS (KEMSA) (specify which tests)', '', 'Pull System', 'Quarterly', 'Yes', 'KEMSA', 'Yes', 'Milivent Ndia Nyakio', '0720323405', '5 ', 'Stock ledger book', 'Yes', 'Monthly', '  in the lab store', '', ' '),
(11, '11740', 'Partner Budget (specify which tests)', '', 'Pull System', 'Others', 'No', '0', 'Yes', 'Dini Jilo', '0723067214', '', 'Stock ledger book', 'Yes', 'Monthly', '  in the lab', ' ', ' '),
(12, '14831', 'Partner Budget (specify which tests)', '', 'Pull System', 'Others', 'No', '0', 'No', '', '', '', 'Not recorded	', 'No', '0', '  TB Lab', ' ', ' GeneXpert in this facility is used as a sample referral center for Belgut District, Kipkelion, Bomet and Chebalungu Districts.'),
(13, '14607', 'Partner Budget (specify which tests)', '', 'Push System', '0', 'No', 'Partner', '0', '', '', 'Since May Have only received 30 cartridges in September', 'Not recorded	', 'No', '0', '  TB Lab', ' ', 'TB program is facing a big challenge in the region. They need a lot of support.'),
(14, '14749', 'Partner Budget (specify which tests)', '', 'Pull System', 'Monthly', 'Yes', 'NPHLS', '0', '', '', '', 'Not recorded	', 'No', '0', '  In the TB lab', ' ', ' Majority of sites in Nandi County send samples to Kapsabet District.\r\nKabiri Sang, Kilibwoni HC, Chepkuma Dispensary, Kapsisiywo Dispensary, Nandi Hills DH, Kingwal DH, Kombe Dispensary, Kabiyet HC, Kapkangani HC, Kimondi Dispensary.');
